/gss0.bdstatic.com/5foIcy0a2gI2n2jgoY3K/static/fisp_static/common/img/footer/img/img3_32c9dc6.png&amp;quot;); font-family: arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft Yahei&amp;quot;, 微软雅黑, 宋体, Tahoma, Arial, Helvetica, STHeiti; white-space: normal;&quot;&gt;&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;',9,1517564460,1517564460,100,1,NULL),(4,1,'哈哈','&lt;p&gt;&lt;strong&gt;见客户老客户健康和健康很快就好&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;看了就会健康&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;就会感觉好&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;就会感觉好&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;脚后跟&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;img src=&quot;http://img.baidu.com/hi/jx2/j_0001.gif&quot;/&gt;&lt;/strong&gt;&lt;/p&gt;',11,1517565001,1521010538,22,1,NULL),(5,4,'文章标题','<p>a<br/></p>',16,1521873307,1521873357,200,2,1521873357),(6,4,'阿斯顿发斯蒂芬','<p>萨达<br/></p>',15,1521873933,1522746152,100,1,NULL),(7,1,'主持人马东起诉浦发银行等索赔320万：擅自使用其肖像姓名','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">北京海淀法院微博3月28日消息，因认为浦发银行未经允许擅自使用其肖像、姓名制作广告宣传，贵阳来点广告传媒有限责任公司、北京汉王清风科技有限公司对侵权广告进行传播，主持人马东将上海浦东发展银行股份有限公司、上海浦东发展银行股份有限公司信用卡中心、贵阳来点广告传媒有限责任公司、北京汉王清风科技有限公司诉至法院。海淀法院将于3月29日14时开庭审理此案。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">另据中国法院网，</strong><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">原告马东诉称，原告系我国知名主持人、节目制作人，曾担任中央电视台及地方卫视多档电视节目的主持人、导演、制片人，两次担任中央电视台春节联欢晚会导演，参与策划与主持的脱口秀节目《奇葩说》自2014年上线后在爱奇艺播放平台的总播放量已突破26亿。原告已经具有了相当庞大的观众和粉丝群体，其肖像、姓名具有极高的公众知名度、辨识度、商业代言以及宣传价值。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">作为一名公众人物，原告对个人形象、名誉、声誉的维护极其重视。多年来，虽常有广告商向原告寻求合作机会，但原告对于广告代言的选择始终秉承极为审慎的态度。据原告调查了解，</span><strong style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">被告浦发银行信用卡中心于2017年3月30日在其新浪官方微博发布微博，文字内容为：“浦发美运白金卡升级版出炉！免年费再等你一年！#别说你不知道神卡哦#”，同时用作配图的宣传海报中擅自使用原告的肖像和姓名，通过编辑、合成的技术手段将原告肖像与浦发银行、浦发银行信用卡中心的产品刻意地拼接结合，并配以文字介绍“奇葩说著名主持人马东向你推荐浦发美运白金卡升级版！”</strong><br/><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">更令原告震惊的是，该宣传海报中甚至编造了一段原告从未表达过的语句，称“大家喜欢看我节目，据说是因为我喜欢‘自黑’，其实关于‘黑’我的确偏爱很多，例如这张卡就够好！”</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">该条微博内容在新浪微博平台被大量转发、评论，众多网友认为原告也在使用该产品，已经构成了原告代言合作的误认。</strong><br/><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">同时，贵阳来点公司将上述宣传海报及相关产品宣传报道进行编辑后，于2017年4月1日发布在其运营的微信公众号“我们都是贵州人”中，该篇公众号文章的阅读量高达近7000，并被大量第三方网站刊载传播。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">此外，被告汉王清风公司将上述宣传海报发布在其所经营的广告产品“汉王清风清霾广告机”中，该广告产品已被多家大型知名企业启用，上述宣传海报存在大范围传播的现实可能性。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">原告认为，浦发银行多年位列“财富世界500强”，作为全球知名中资商业银行，拥有着庞大的消费者群体及较高的社会公信度。浦发银行、浦发银行信用卡中心未经原告许可擅自使用原告肖像和姓名，利用原告的肖像、姓名及所附商业价值，对其信用卡新产品进行宣传与销售，其误导公众、造成原告代言假象的主观恶意及商业盈利目的明显，严重侵犯了原告的肖像权、姓名权等合法权益。贵阳来点公司、汉王清风公司作为侵权广告的发布者和直接受益者，亦是对原告上述合法权益的严重侵犯。故原告诉至法院，请求法院判令：四被告停止侵权，包括但不限于浦发银行、浦发银行信用卡中心、贵阳来点公司删除发布在各类平台的所有载有侵权信息的图片、文章，汉王清风公司撤回广告机中载有侵权信息的宣传广告；浦发银行、浦发银行信用卡中心分别在其官方网站、新浪微博及微信公众号显著位置，贵阳来点公司在其微信公众号显著位置，汉王清风公司在其微信公众号及其全部清霾广告机产品显著位置上就侵权行为公开赔礼道歉、消除影响，致歉内容应经原告事先认可；</span><strong style=\"color: rgb(51, 51, 51); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">四被告向原告赔偿经济损失300万元；四被告向原告赔偿精神损害抚慰金20万元；四被告承担因维权支出的合理费用暂计1万元。</strong></p>',9,1522296234,1522296436,100,2,NULL),(8,1,'特朗普欲对亚马逊动手 电商巨头蒸发500亿美元','<p class=\"otitle\" style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">（原标题：特朗普欲对亚马逊“动手”，电商巨头蒸发500亿美元）</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><a href=\"http://money.163.com/keywords/7/8/7f8e56fd/1.html\" title=\"美国\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">美国</a>总统<a href=\"http://money.163.com/keywords/7/7/72796717666e/1.html\" title=\"特朗普\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">特朗普</a>向来对<a href=\"http://money.163.com/keywords/4/9/4e9a9a6c900a/1.html\" title=\"亚马逊\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">亚马逊</a>很不待见，这与他和<a href=\"http://money.163.com/keywords/8/1/8d1d7d2265af/1.html\" title=\"贝索斯\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">贝索斯</a>间的恩怨有一点关系。据外媒援引消息人士的话称，特朗普对亚马逊没有缴纳互联网税依然耿耿于怀，并计划改变亚马逊的税收待遇。</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">“他就是对亚马逊念念不忘，完全沉迷于其中。”知情人士称，“特朗普已经讨论改变亚马逊的纳税待遇，因为他的朋友告诉他，<a href=\"http://money.163.com/keywords/7/3/75355546/1.html\" title=\"电商\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">电商</a>巨头正在伤害他们的生意、扼杀传统的大型购物商场和实体零售店，总统也持类似的观点。”</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">报道一出现，亚马逊周三盘前下跌超3%，开盘后便快速走低，一度下跌超7.3%，总市值蒸发近530亿美元。</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">事实上特朗普与贝索斯的“矛盾”由来已久，早在前年竞选时，特朗普就指出贝索斯正利用媒体的力量去影响华盛顿特区的政治家，从而给亚马逊带来税务方面的利益，存在“严重的反垄断问题”。特朗普还曾在竞选活动中表示，如果自己当选总统，亚马逊会有大麻烦。当时贝索斯也向特朗普发起攻击，声称特朗普在破坏美国的民主，并建议特朗普离得远远的，扬言要用火箭把特朗普送上太空。《华盛顿邮报》在大选期间也刊登了大量破坏特朗普形象的报道。</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">去年6月，对当时医改表决推进迟缓心存不满的特朗普被《华盛顿邮报》一篇揭露特朗普高尔夫俱乐部内悬挂的印有本人头像的《时代》杂志封面是虚假的报道怒不可遏，发推指责亚马逊未缴纳互联网税，又讽刺《华盛顿邮报》是一家“假新闻(FAKE NEWS)”媒体。</p><p class=\"f_center\" style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: center; white-space: normal; background-color: rgb(255, 255, 255);\"><img alt=\"特朗普欲对亚马逊动手 电商巨头蒸发500亿美元\" src=\"http://crawl.nosdn.127.net/857d3f5ca3a2b9a83d35e475b27fa71a.png\"/></p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">去年8月，特朗普再次发推称：“亚马逊对纳税的零售商造成巨大伤害。整个美国的乡镇、城市和各州都在受到伤害，许多就业机会正在流失。”</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p><a target=\"_self\" class=\"ad_hover_href\" style=\"color: rgb(15, 107, 153); text-decoration-line: underline; width: 30px; height: 17px; position: absolute; left: 0px; bottom: 0px; z-index: 10; background: url(&quot;http://img1.126.net/channel18/ad.png&quot;) no-repeat;\"></a></p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">至于互联网税的问题，这确实是横亘在电商及各州政府间的争议性话题，亚马逊也在加速税收政策改革。去年4月1日起，亚马逊对45个州征收销售税。此后亚马逊不征收销售税的地区仅包括阿拉斯加、特拉华、俄勒冈、蒙大拿和新罕布什尔。全美州议会联合会(National Conference of State Legislatures)报告称，由于无法向网购消费者收取销售税，2012年美国损失了233亿美元的税收收入。</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">今年2月，美国财长姆努钦在众议院筹款委员会的听证会上称，政府“强烈感觉”应当对互联网电商征收销售税。</p><p style=\"margin-top: 32px; margin-bottom: 0px; padding: 0px; font-size: 18px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 32px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">美国<a href=\"http://money.163.com/keywords/7/7/767d5bab/1.html\" title=\"白宫\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">白宫</a>方面的最新回应是，当前还没有针对亚马逊调整政策，但一直都在关注诸多不同的选项。</p><p><br/></p>',8,1522296500,1522296500,100,2,NULL),(9,1,'扫码支付限额500元 商户称影响甚微','<p class=\"detailPic\" style=\"margin: 0px auto 10px; padding: 0px; text-indent: 28px; text-align: center; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://p0.ifengimg.com/fck/2018_13/949e2a065d9e7a2_w300_h199.jpg\" alt=\"\"/></p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">扫码支付已经融入到人们的生活，方便快捷的支付方式在带来便利的同时也存在着一定隐患。4月1日起，央行发布的《条码支付业务规范（试行）》将正式开始实施，条码支付额度将实行分级管理，对于线下扫描静态码的支付方式，每人每日最多不能超过500元。专家认为，新规的出台更加规范了市场环境，对用户个人信息保护也起到至关重要的作用。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>支付新规4月起实施</strong></p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">随着业务规范的实施，条码支付正式告别“无证驾驶”时代，央行将条码支付的风险防范能力分为ABCD四级，并对不同风险级别的条码支付设置了金额上限。也就是说，以后扫码支付单日消费金额将受限制。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">通俗来讲，央行把扫码支付分为动态和静态两种：动态扫码根据ABC三级分别设置自主约定、5000元、1000元的金额上限；静态扫码设限最低，单日最高不超过消费500元，新规从今年4月1日正式实施。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">据业内人士介绍，目前普遍存在的店面张贴二维码，由消费者使用微信、支付宝等进行扫码支付的情况，被称为“静态扫码支付”，而消费者打开手机出示给别人供扫码的条形码，则属于动态条码。央行认为静态条码支付方式风险较大，除了做出500元的限额外，明确表示银行和支付机构提供的条码支付必须要用动态条码。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">此外，新规对静态条形码也有了新标准。展示静态条形码的介质应放置在商户收银员视线范围内，商户应定期对介质进行检查；在静态条形码介质显著位置明显展示收款方信息，便于用户核对。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>商户表示影响甚微</strong></p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">随着扫码支付的迅速普及，与之相关的欺诈案例也越来越多，限额保护是针对二维码消费使用不太熟练、无法清晰辨认欺骗行为的用户，这批用户在中国占很大量级。据易观金融分析师王蓬博介绍，扫码支付存在消费者通过静态码被盗取存款资金的的风险。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">需要注意的是，每日限额500元并非单一商家限额500元，而是用户当天静态码的支付受限总额。另外，对于消费者来说，一天内使用静态码支付不得超过500元，是指同一家支付机构的单日累积静态码交易金额，如果用户绑定了多家银行卡，则每张银行卡的限额分开计算。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">在新规实施后，或许会对街头的小商家产生一些影响。比如对于卖煎饼的老板来说，一天收入超过500元后，就需要单独扫每位顾客的二维码，如果遇到赶时间的上班族，则会带来一些不便。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">北京商报记者近日在走访时了解到，大多数商户认为新规影响有限。例如，目前部分餐馆已经完成扫码枪等支付设备的安装。一家超市店主表示，用户每次消费十几元的价格不会产生很大影响，但对于一些购物量较大的客户来说，每日500元的额度可能会出现不够用的情况。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">在王蓬博看来，对很多中高端消费的商家来说，新规的出台可能会带来一些限制，如果想继续进行比较通畅的移动支付，可能需要去购买一套专用的设备。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: &quot;Microsoft Yahei&quot;; white-space: normal; background-color: rgb(255, 255, 255);\">苏宁互联网金融研究中心主任薛洪言也表示，静态扫码消费金额设限对绝大多数用户而言都不会有实质性影响，因为这种条码支付一般是用于小微交易。</p><p><br/></p>',12,1522296561,1522296561,100,2,NULL);
