INSERT INTO `backstage_notice` VALUES (5,'Facebook爆出史上最大丑闻，数据帝国崩解危机引爆','<p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">美国时间 20 日，全球最大社交网站 Facebook 遭遇公司成立以来的最大危机。长期以来， Facebook 开放 API 接口让外部第三方公司在 Facebook 平台上提供心理测验或者是小游戏，此举丰富了 Facebook 此类社交平台的内容丰富度，也通过用户参与分享进一步强化了用户之间的社交关系的黏着度。这项纯粹的商业活动看起来似乎无害，却因为爆出一家位于英国的数据分析公司剑桥分析（Cambridge Analytica) 在未经用户许可的情况下，盗用了高达 5 千万用户的个人资料，而剑桥分析正是在 2016 年特朗普竞选团队所僱用的的数据分析公司，用来分析预测，并涉嫌以此进行社交媒体操作影响大选中的选民行为。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">这件事的严重性在美国已如野火燎原般延烧开来，包括 Facebook 、推特、Snapchat 等美国主要社交网站公司股价在盘中均重挫大跌，其中Facebook 股价一度重挫超过 6%，即使最后收盘仅下跌约 2%，但从这件事从周末开始发展迄今，在本周开盘的两个交易日中， Facebook 股价已经跌掉了 11.4%，市值更是在短短两天之间蒸发了 600 亿美元。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">过去 2 天， Facebook 大量用户数据遭到第三方数据公司“盗用”的事件，已然滚成一个超大雪球般的丑闻事件，在美国、英国、以及其他国家，美国 FTC、英国国会都已要求 Facebook 接受调查，其中甚至传出，根据美国 FTC 与 Facebook 在 2011 年所签订的相关数据保护协议，若此一事件调查结果认定 Facebook 违反协议规定，将遭到高达 2 兆美元的天价罚款，相当于目前脸书市值的近 4 倍水准，而显然这将会是足以让 Facebook 帝国毁于一旦的灭顶之灾。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"large\" src=\"http://t10.baidu.com/it/u=4144854600,566896650&fm=173&app=25&f=JPEG?w=550&h=310&s=4725B044460A275D4FB50D8F03003088\" style=\"border-width: 0px; border-style: initial; width: 537px;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">即使 FTC 的天价罚款不见得真会发生，但此一事件对 Facebook 而言，已然演变成为一个超大丑闻，更要命的是，从美国时间 17 日脸出关闭剑桥数据 Facebook 页面、并禁止其他在 Facebook 上的一切广告商业活动开始， Facebook 迄今都坚称其数据并没有被盗用窃取造成的用户资料外洩，而只是被“误用”，但这样的说法显然不足以平息外界的疑虑、甚至是愤怒。特别是到目前为止， Facebook 仅透过公关窗口发表声明说明状况，而身为公司创办人、基本上与 Facebook 画上等号的马克扎克伯格到目前为止都还没有任何发言表态，更是引发众怒。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">这其中的关键在于，虽然 Facebook 是在美国时间 17 日主动封杀剑桥数据在其社交平台上的活动，并且主动在 Facebook 博客说明封杀剑桥数据的原因，同时也发信给多家媒体强调此一事件不是 Facebook 用户资料被盗用，甚至是 Facebook 对于用户数据的保护被破解的问题。但事实上， Facebook 并不是真的主动自愿性的把整起事件公开在阳光下，而是因为事前已经知道有多家美国媒体将在隔天报导此一事件，因此先发制人主动抢取话语权。这样的作法看似聪明，但这家被认为已然是全球最大“媒体”公司的社交媒体公司却犯了一个天大的错误，也就是当有媒体揭露 Facebook 处理此一事件的操作手法后，居然收到来自 Facebook 的提告威胁，这样的作法无疑是提油救火，让整起事件的发展一发不可收拾。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">到底发生什么事？</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">这整件事在短短 5 天内，演变到如今这个地步，其中有一个关键的转折，来自于剑桥分析共同创办人 Christopher Wylie 向英国卫报的主动爆料，Christopher Wylie 对卫报表示，剑桥数据公司早在 2013 年就成立了，它由美国共和党的亿万富豪 Robert Mercer 出资，并由曾经担任特朗普顾问的 Steve Bannon 主导成立，Steve Bannon 并且找 Christopher Wylie 组建数据分析团队。当时这家公司成立的目的就很明确，就是要通过海量数据分析研究，进一步得出操作社会舆论风向，借此影响 2014 年美国国会大选，以及 2016 年的美国总统选举，但后来 Christopher Wylie 发现，如果要做到更准确的用户行为预测，就必须要通过与心理与行为分析的专家合作，因此他找上了英国剑桥大学合作，但剑桥大学并未答应，因而，剑桥数据转向与个别研究人员合作，也就是当时任职于剑桥大学心理测量中心的 Aleksandr Kogan。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">在 Aleksandr Kogan 加入后，他开发了“这是你的数字化生活”(thsisyourdigitallife)的心理小测验，这类型的心理测验在 Facebook 等社交媒体平台上非常常见，用户会通过参与这样的心理测验，得出一个有趣结果，用户可以选择分享在自己的 Facebook 页面上，进而吸引其他 Facebook 好友注意、甚至跟进参与。事实上，除了这样的心理测验以外，在社交平台上还有更多小游戏或或者是应用，也是用同样的方法取得用户行为的数据资料。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">而由 Aleksandr Kogan 所开发的这款心理测验，总共有 27 万人参与，并在过程中提供了相关数据资料，而通过这款小测验所延伸连接的社交网络，剑桥数据得以进一步扩大得到高达 5000 万个用户数据资料，而后再基于这些资料，建成心理与行为分析模型，其中包括性格倾性、生活满意度、政治观点、甚至个人喜好等等明确可用的资讯指标结果。值得注意的是，当初这款“这是你的数字化生活”向 Facebook 申请准许发布时，是以学术研究的名义申请，而 Facebook 在审核之后并没有继续把关、追踪其取得数据资料的流向用途，是不是符合当初申请的目的，这让这批数据最后流向剑桥分析手裡，被用来达成研究分析选民行为，进而达成创建操作舆论风向、影响选举结果的目的。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"large\" src=\"http://t10.baidu.com/it/u=4266238458,220088251&fm=173&app=25&f=JPEG?w=640&h=517&s=6806C81B030E64E844C901C10100B036\" style=\"border-width: 0px; border-style: initial; width: 537px;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">图丨剑桥公司关系图</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">向英国卫报爆料此一事件的 Christopher Wylie 已于先前离开剑桥分析，根据他自己表示，是因为看到此社交媒体用户数据遭到滥用、进而影响社会的严重后果而受到自己良心谴责，因而宁愿承担违反保密条款的责任，也必须向外界揭露此一事件，更重要的是，Christopher Wylie 认为，这整起事件最可怕之处，不只在于数据资料外洩的风险问题，而在于身负为 20 亿用户数据资料把关的Facebook 从头到尾都知道这件事。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">2018年3月21日， Facebook 公司员工们召开了一次内部问答会，阐述关于在上周五爆出的与特朗普关系密切的数据公司剑桥分析公司滥用 Facebook 用户数据事件的一些情况。这是该公司在事发后首次举行相关的讨论会。不过据 The Daily Beast 报道，Facebook CEO 扎克伯格并没有参加此次讨论会。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"large\" src=\"http://t10.baidu.com/it/u=1004721459,2166044640&fm=173&app=25&f=JPEG?w=610&h=356&s=5C0A7433199EC5C85EF435DB0100C0B1\" style=\"border-width: 0px; border-style: initial; width: 537px;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">图丨大事记</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">雪球效应才刚开始而已</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">这件事这两天在美国社会所引发的风暴已经是炸开了锅，但 DT 君必须说，这一切其实才刚开始。就算今天扎克伯格出面说明道歉，也没办法阻止这个雪球继续越滚越大。因为除了美国总统大选外，在先前英国脱离欧盟（Brexit) 公民投票中，剑桥分析也被英国政府相关单位怀疑可能涉入其中，因而开始对其展开调查，英国国会并以此要求 Facebook 创办人扎克伯格出席相关听证会。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">事实上，以 Facebook 遍布全球的 20 亿用户来看，其所掌控的影响力早已是让各国政府严密注意的风险所在，从选举活动到恐怖攻击等等， Facebook 一直都是经常被提到的数据资讯风险源。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"normal\" width=\"530px\" src=\"http://t11.baidu.com/it/u=1058987044,2577048629&fm=173&app=25&f=JPEG?w=530&h=298&s=D26DB0448C0406570ACAA58C0300308F\" style=\"border-width: 0px; border-style: initial; display: block; margin: 0px auto;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">值得注意的是，有关于数据资料风险这个问题，在过去二十年的互联网发展历程中持续被提及是非常严重的问题，也曾有人提出这将会是足以毁灭互联网在人类社会中扮演重要角色重大危机。但这么多年过去，从互联网、大数据、到如今的人工智能，数据资料在人类社会科技应用中扮演的角色越来越重要，有越来越多的个人数据通过不同工具被曝露在不同地方，在用户知情或不知情的情况下被拿来使用，但数据资料安全保护这个问题，却始终没有得到一个足以取得共识的解法，甚至可以说，每一次出现重大数据安全风险事件，最后都是以补丁式的方法处理，面对如无法计数的海量数据持续涌来，补丁式的数据安全保护技术或解决方案，都只是一时的自我安慰而已。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">数据被视为是新时代的石油，尤其要运用大数据、人工智能带来的好处，一个前提就是需要使用大量的数据资料，不过，资料的收集及取用很容易涉及正当性的问题，更有不少业者以游走在侵犯个人隐私边缘的手段来使用这些数据，因此欧盟议会在 2016 年 4 月通过欧盟通用资料保护规范（GDPR），便将科技衍生的个资保护内容纳入其中，而且 GDPR 即将在 2 个月之后正式上路。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">而 GDPR 之所以被称作是史上最严格的个资法，一是保护的个资范畴大，除保护欧盟民众个人可识别资料（PII）外，更明确“全部或部分”以“自动化方式”搜集、处理或利用的个人资料都包含在内，像是 Cookie、IP 位置、GPS 定位等，都属于这次 GDPR 新增受保护的个资内容之一。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">另一个原因就是最祭出高额罚款，当企业或组织外泄了欧洲民众的个人资料，外泄的企业或组织都必须在 72 小时内通报资料保护主管机关（Data Protection Authority），个资外泄情节较轻者，可能被罚款 1 千万欧元或全球营业额 2％作为罚款；情节较重者，则是被罚款 2 千万欧元或全球营业额 4％作为罚款。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">而 Facebook 此次爆发 5000 万用户的惊人资料外泄事件，不巧就遇上 GDPR 即将上路，欧盟的资料保护专员乔霍瓦预定本周造访华府时，也将与 Facebook 、美国商务部长罗斯这个问题，欧盟执委会已要求成立任务小组调查 Facebook 。此次事件也突现一个重点，社交平台、甚至是人工智能公司未来都得视小心警慎，因为根据 GDPR，当公司必须以“清晰明了的语言、可理解的形式”向用户提出请求同意。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"large\" src=\"http://t10.baidu.com/it/u=3509710338,390294581&fm=173&app=25&f=JPEG?w=546&h=300&s=D3337C6E16E7C55316AE9C920300C099\" style=\"border-width: 0px; border-style: initial; width: 537px;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">相较于美国的Facebook，中国的今日头条也有类似的遭遇。2017年7月，人民网发文指责今日头条算法会分发低俗内容。这是因为用户往往会被猎奇、色情、暴力等标题以及封面吸引，加上今日头条不完善的算法，就会陷入只有这些内容的“信息茧房”之中。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">2017年12月，今日头条和凤凰新闻被网信办约谈，后者相关负责人指出，今日头条和凤凰新闻手机客户端违反国家有关互联网法律法规和管理要求，传播色情低俗信息，存在严重导向问题，对网上舆论生态造成恶劣影响。在尚未获得互联网新闻信息服务资质的情况下，今日头条手机客户端违规转载新闻信息，且“标题党”问题突出，严重干扰了网上传播秩序。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">2018年1月，今日头条再次被约谈。只不过这次约谈今日头条的是工信部。同一时间被约谈的还有支付宝和百度，工信部表示，这三家企业均存在用户个人信息收集使用规则、使用目的告知不充分的情况。</p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal;\"><img class=\"normal\" width=\"527px\" src=\"http://t11.baidu.com/it/u=1158233785,527737827&fm=173&app=25&f=JPEG?w=527&h=300&s=8C62EA0242A544B613162FBA03009016\" style=\"border-width: 0px; border-style: initial; display: block; margin: 0px auto;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">可见，无论是中国还是美国，用户的隐私信息神圣不可侵犯。任何未经允许就调用他们的企业，势必将得到应有的制裁。在GDPR出台以后，这种规章制度将会更加清晰透明，也让这些大企业不再有法律空子可以钻。</p><p style=\"margin-top: 22px; margin-bottom: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal;\">此次 Facebook 事件在美国已被称为“数据丑闻”(Data Scandal)，但在 DT 君看来，这整起事件就是捅破了长期大家都不愿意去面对的真相，而且是所有人都知道、只是没有讲出来的事实，但当这次被捅出来的对象是手握 20 亿用户，且被认为是具有最大话语权影响力的社交媒体，所可能牵动的影响，将不只是几家美国社交媒体的股价下跌、市值蒸发这么简单。而会是未来以数据资源作为最重要推动力量的新经济的一个重大挑战，当数据使用被严格规范、当用户因为恐惧而抵制数据资源分享，是否可能进一步造成数据资源经济发展的重大危机，将会非常值得观察。</p><p><br/></p>',1521686398,1521686398,11,1,NULL),(6,'2018年高考进一步提高中西部地区及人口大省录取率','<p class=\"text\" style=\"margin-top: 0px; margin-bottom: 28px; word-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Helvetica, sans-serif; white-space: normal; text-indent: 2em;\">新华社北京3月21日电（记者 胡浩）教育部21日公布《关于做好2018年普通高校招生工作的通知》，对今年的高校招生做出部署。通知要求，继续实施“国家支援中西部地区招生协作计划”，进一步提高中西部地区及人口大省高考录取率。</p><p class=\"text\" style=\"margin-top: 0px; margin-bottom: 28px; word-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Helvetica, sans-serif; white-space: normal; text-indent: 2em;\">通知提出，要积极稳妥推进高校考试招生改革。上海市、浙江省要深入总结完善高考综合改革试点经验，不断研究解决改革过程中遇到的新情况、新问题。北京市、天津市、山东省、海南省要积极借鉴试点经验，坚持从本地实际出发，精心组织、平稳实施好改革试点。</p><p class=\"text\" style=\"margin-top: 0px; margin-bottom: 28px; word-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Helvetica, sans-serif; white-space: normal; text-indent: 2em;\">通知要求，强化对高中学生综合素质档案的使用，在保送生、自主招生、综合评价试点、高水平艺术团、高水平运动队、艺术体育类专业、运动训练和民族传统体育、高职分类招考等类型招生中，将学生综合素质评价结果作为招生录取的重要参考。进一步推进减少高校招生录取批次改革，实施高考综合改革及合并本科批次的省份，要合理划定特殊类型招生最低录取文化课分数线，不得低于合并批次前的相应要求。</p><p class=\"text\" style=\"margin-top: 0px; margin-bottom: 28px; word-wrap: break-word; font-family: &quot;Microsoft Yahei&quot;, Helvetica, sans-serif; white-space: normal; text-indent: 2em;\">此外，根据《国务院关于深化考试招生制度改革的实施意见》和《教育部 国家民委 公安部 国家体育总局中国科学技术协会关于进一步减少和规范高考加分项目和分值的意见》相关规定，从2015年1月1日起，取消体育特长、中学生学科奥林匹克竞赛、科技类竞赛、省级优秀学生、思想政治品德有突出事迹者全国性加分项目。今年高考，这些加分项目将全面取消。</p><p><br/></p>',1521686501,1521686501,33,1,NULL),(7,'港媒赞两会意义“划时代” 认为习近平讲话展现对港澳关爱','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　<a target=\"_blank\" href=\"http://undefined\">中新社</a>香港3月21日电 十三届全国人大一次会议20日闭幕，中共中央总书记、国家主席、中央军委主席习近平在闭幕会上发表重要讲话。21日出版的多家香港主要报章对全国两会的闭幕进行大篇幅重点报道，并发表评论认为，此次两会有划时代的意义，习近平讲话展现其心系人民，关爱港澳。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　香港《大公报》在头版头条以《习近平：支持港澳融入国家发展》为题进行大篇幅报道，并在重要版面全文刊发《习近平在第十三届全国人民代表大会第一次会议上的讲话》。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　该报并发表社评指出，此次两会的重要性和深刻意义都是划时代和里程碑式的，必将在国家发展历程中留下不可磨灭的贡献和影响。13亿中国人民在中国共产党和习近平总书记领导下建设自己更美好家园的航船，正以百倍自信和无比决心乘风破浪，驶向胜利明天。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　香港《文汇报》亦在头版头条报道习近平讲话，并重点关注“支持港澳融入国家发展”部分内容。该报还特别提到，在这篇不到5000字的讲话中，习近平84次提及“人民”，阐释“以人民为中心”的执政理念。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　该报在当日发表题为《习主席心系人民关爱港人 坚定不移贯彻“一国两制”》的社论指出，习近平在十三届全国人大一次会议闭幕会上发表的重要讲话，充分体现他心系人民、对人民忠诚、全心服务人民的领袖情怀；而有关港澳事务的论述，强调对港澳的关爱、支持和落实“一国两制”方针的决心，显示中央对港政策坚定不移，一如既往支持香港发展，为香港创造机遇。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　香港《商报》大篇幅报道习近平重要讲话，并盘点讲话中多处“金句”。该报在时评《增强国家意识 融入国家发展大局》中表示，习近平的讲话充分体现了中央对香港的高度重视和关心，亦表现了香港在国家新时代新征程中的突出地位，为香港未来的发展指明了方向，贯注了强大动力，提供了有力的保障。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; line-height: 30px; font-family: 微软雅黑; white-space: normal; background-color: rgb(238, 242, 246);\">　　评论强调，国家对港支持不遗余力，香港亦要增强国家意识和爱国精神。港人从来就是全国人民一份子，当然应共担民族复兴的历史责任，共享祖国繁荣富强的伟大荣光。(完)</p><p><br/></p>',1521686556,1521686556,2,1,NULL),(10000,'公告测试','<p>公告测试公告测试公告测试公告测试公告测试公告测试公告测试公告测试公告测试公告测试</p>',1523239303,1523239303,100,1,NULL),(10001,'3453543543','<p>543453453453453</p>',1523239481,1523239481,543,1,NULL);
